import { useState } from 'react'
import axios from 'axios';
// import send_API_request from '../modules/request_API';


const Choice_menu = () => {
    const [dish_type, setDish_type] = useState('')
    // const [add_food, setAdd_food] = useState([]);
    // const [dont_add_food, setDont_add_food] = useState([]);
    const [dish_name, setDish_name] = useState('');
    const [cook_time, setCook_time] = useState(99999);
    const [meal_type, setMeal_type] = useState('');
    const [cuisine, setCuisine] = useState('');
    const [results_number, setResults_number] = useState(1);

    const send_input_data = async (req, res) => {
        const request_options = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({
                dish_type,
                dish_name,
                cook_time,
                meal_type,
                cuisine,
                results_number
            })
        };
        try {
            const response = await fetch('http://localhost:3030', request_options);
            console.log(response);
            const data = await response.json();

            console.log(typeof data);
            // Process the response or perform any additional actions
            // res.status(200).json({ message: 'Data sent successfully' });
          } catch (error) {
            // Handle any errors that occur during the request
            // res.status(500).json({ error: 'An error occurred while sending the data' });
          }
    }
    // send_API_request({
    //     dish_type,
    //     dish_name,
    //     cook_time,
    //     meal_type,
    //     cuisine
    // })

    return (
        <div className="container">
            <h1 className="title">Generate your recipe</h1>
            <div id="form">
                <div className="forms">
                    <div className="form-group">
                        <label >Desired type:</label>
                        <input type="text" id="food_query" onChange={(e) => {
                            setDish_type(e.target.value)
                        }} />
                    </div>
                    {/* <div className="form-group">
                        <label >I'd like to add:</label>
                        <input type="text" id="likes" />
                    </div> */}
                    {/* <div className="form-group">
                        <label>Please don't add:</label>
                        <input type="text" id="dislikes" />
                    </div> */}
                    <div className="form-group">
                        <label >I know the name:</label>
                        <input type="text" id="dish_title" onChange={(e) => {
                            setDish_name(e.target.value)
                        }} />
                    </div>
                    <div className="form-group">
                        <label >How much time<br />do you have?</label>
                        <select name="time_cooking" id="time_cooking" onChange={(e) => {
                            setCook_time(e.target.value)
                        }}>
                            <option value="99999">I have plenty of time</option>
                            <option value="10">10 minutes</option>
                            <option value="30">30 minutes</option>
                            <option value="60">1 hour</option>
                            <option value="120">2 hours</option>
                            <option value="180">3 hours</option>
                        </select>
                    </div>
                    <div className="form-group">
                        <label for="meal_type">Food type</label>
                        <select name="meal_type" id="meal_type" onChange={(e) => {
                            setMeal_type(e.target.value)
                        }}>
                            <option value="">Any</option>
                            <option value="antipasti">Antipasti</option>
                            <option value="antipasto">Antipasto</option>
                            <option value="appetizer">Appetizer</option>
                            <option value="beverage">Beverage</option>
                            <option value="breakfast">Breakfast</option>
                            <option value="brunch">Brunch</option>
                            <option value="condiment">Condiment</option>
                            <option value="dessert">Dessert</option>
                            <option value="dip">Dip</option>
                            <option value="drink">Drink</option>
                            <option value="fingerfood">Finger Food</option>
                            <option value="hor-doeuvre">Hors d'oeuvre</option>
                            <option value="main-course">Main Course</option>
                            <option value="marinade">Marinade</option>
                            <option value="morning-meal">Morning Meal</option>
                            <option value="salad">Salad</option>
                            <option value="sauce">Sauce</option>
                            <option value="seasoning">Seasoning</option>
                            <option value="side-dish">Side Dish</option>
                            <option value="snack">Snack</option>
                            <option value="soup">Soup</option>
                            <option value="spread">Spread</option>
                            <option value="starter">Starter</option>
                            <option value="marinade">Marinade</option>
                        </select>
                    </div>
                    <div className="form-group">
